import 'bootstrap/dist/css/bootstrap.min.css';
import { Container,Col } from 'react-bootstrap';
import './App.css';


function Back() {


  return (

    <div id='Back' className=' mb-5'>
        <Container>
            <Col className='Back mt-5'>
            <Col className='Back2 col-lg-12 d-flex flex-column justify-content-center '> 
             <center><h1 className='align-center P1' >When a man's stomach is full it makes no difference whether he is rich or poor. </h1></center> 
         
            </Col>
            </Col>
        </Container>




          </div>
  );
}

export default Back;
